import mathmotifs = [    "GAGGTAAAC", "TCCGTAAGT", "CAGGTTGGA", "ACAGTCAGT", "TAGGTCATT",    "TAGGTACTG", "ATGGTAACT", "CAGGTATAC", "TGTGTGAGT", "AAGGTAAGT"]sequence_S = "CAGGTTGGAAACGTAATCAGCGATTACGCATGACGTAA"motif_length = 9n_sequences = len(motifs)counts = {'A': [0]*9, 'C': [0]*9, 'G': [0]*9, 'T': [0]*9}for seq in motifs:    for i, nucleotide in enumerate(seq):        counts[nucleotide][i] += 1frequencies = {'A': [], 'C': [], 'G': [], 'T': []}for base in ['A', 'C', 'G', 'T']:    frequencies[base] = [count / n_sequences for count in counts[base]]null_model = 0.25pwm = {'A': [], 'C': [], 'G': [], 'T': []}for base in ['A', 'C', 'G', 'T']:    for p in frequencies[base]:        if p > 0:            score = math.log(p / null_model)        else:            score = -999.0        pwm[base].append(round(score, 4))window_scores = []for i in range(len(sequence_S) - motif_length + 1):    window = sequence_S[i : i + motif_length]    score = 0    for pos, char in enumerate(window):        score += pwm[char][pos]    window_scores.append((i, window, score))print("1. Count Matrix")print(f"{' ': <4} {'1':<4} {'2':<4} {'3':<4} {'4':<4} {'5':<4} {'6':<4} {'7':<4} {'8':<4} {'9':<4}")for base in ['A', 'C', 'G', 'T']:    print(f"{base}: " + " ".join(f"{x:<4}" for x in counts[base]))print("\n3. Relative Frequencies Matrix")for base in ['A', 'C', 'G', 'T']:    print(f"{base}: " + " ".join(f"{x:<4.2f}" for x in frequencies[base]))print("\n4. Log-Likelihood Matrix (PWM)")for base in ['A', 'C', 'G', 'T']:    print(f"{base}: " + " ".join(f"{x:<7.2f}" for x in pwm[base]))nume_fisier = "rezultat_analiza.txt"with open(nume_fisier, "w") as f:    header = "5. Analysis of Sequence S\n"    header += f"{'Pos':<5} {'Window':<12} {'Score'}\n"    header += "-" * 30 + "\n"        f.write(header)     print(header, end="")     found_signal = False    for idx, window, score in window_scores:        label = ""        if score > 0:            label = "<< POTENTIAL SIGNAL"            found_signal = True                line = f"{idx:<5} {window:<12} {score:<10.4f} {label}"                f.write(line + "\n")         print(line)         